import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import { ThemeProvider } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import theme from './theme';
import MainLayout from './components/Layout/MainLayout';
import StoreLayout from './components/Layout/StoreLayout';
import Dashboard from './pages/Dashboard';
import StorePage from './pages/Store/Home';

// 臨時頁面組件
const TemporaryPage = ({ title }) => (
    <div style={{ padding: 20 }}>
        <h2>{title}</h2>
        <p>此頁面正在開發中...</p>
    </div>
);

function App() {
    return (
        <ThemeProvider theme={theme}>
            <CssBaseline />
            <Routes>
                {/* 管理後台路由 */}
                <Route path="/admin" element={<MainLayout>
                    <Routes>
                        <Route path="/" element={<Dashboard />} />
                        <Route path="products" element={<TemporaryPage title="商品管理" />} />
                        <Route path="categories" element={<TemporaryPage title="商品分類" />} />
                        <Route path="orders" element={<TemporaryPage title="訂單管理" />} />
                        <Route path="promotions" element={<TemporaryPage title="促銷活動" />} />
                        <Route path="customers" element={<TemporaryPage title="會員管理" />} />
                        <Route path="reports" element={<TemporaryPage title="銷售報表" />} />
                    </Routes>
                </MainLayout>} />

                {/* 商城前台路由 */}
                <Route path="/store" element={<StoreLayout>
                    <Routes>
                        <Route path="/" element={<StorePage />} />
                        <Route path="category/:category" element={<TemporaryPage title="商品分類" />} />
                        <Route path="product/:id" element={<TemporaryPage title="商品詳情" />} />
                        <Route path="cart" element={<TemporaryPage title="購物車" />} />
                        <Route path="checkout" element={<TemporaryPage title="結帳" />} />
                        <Route path="profile" element={<TemporaryPage title="個人資料" />} />
                        <Route path="orders" element={<TemporaryPage title="我的訂單" />} />
                    </Routes>
                </StoreLayout>} />

                {/* 重定向根路徑到商城 */}
                <Route path="/" element={<Navigate to="/store" replace />} />
            </Routes>
        </ThemeProvider>
    );
}

export default App;
